import { FETCH_NOTES, ADD_NOTE } from '../actions/types';

const initialState = {
  items: [],
  item: {},
};

export default function (state = initialState, action) {
  switch (action.type) {
    case FETCH_NOTES:
      return {
        ...state,
        items: action.payload,
      }
    default:
      return state;
  }
}
